import React, { useState } from "react";

const steps = [
  { label: "Entanglement: Create Bell state Φ⁺" },
  { label: "Encoding: Apply X/Z gates" },
  { label: "Transmission: Send qubit A" },
  { label: "Decoding: Bell measurement" }
];

export default function SuperdenseCodingDemo() {
  const [bit1, setBit1] = useState(null);
  const [bit2, setBit2] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [currentStep, setCurrentStep] = useState(-1);

  async function runSimulation() {
    if (bit1 === null || bit2 === null) {
      alert("Select both bits to transmit.");
      return;
    }

    setLoading(true);
    setResult(null);
    setCurrentStep(0);

    // Simulate process steps with delays
    await new Promise(res => setTimeout(res, 1000));
    setCurrentStep(1);

    await new Promise(res => setTimeout(res, 1000));
    setCurrentStep(2);

    await new Promise(res => setTimeout(res, 1000));
    setCurrentStep(3);

    try {
      const response = await fetch("http://localhost:5000/simulate", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ bit1, bit2 }),
      });
      const data = await response.json();
      setResult(data);
    } catch (err) {
      alert("Error from backend.");
    }
    setLoading(false);
    setCurrentStep(-1); // Reset or keep at last step based on UX choice
  }

  const getStepColor = (index) => {
    if (index === currentStep) return "#0070f3"; // Active color (bright blue)
    if (index < currentStep) return "#00b894"; // Completed color (green)
    return "#aaa"; // Pending color (gray)
  };

  return (
    <div style={{ maxWidth: 900, margin: "auto", fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif", padding: "1rem", backgroundColor: "#f9fbff", borderRadius: 8, boxShadow: "0 8px 16px rgba(0,0,0,0.1)" }}>
      <h1 style={{ textAlign: "center", color: "#003366" }}>
        What is Superdense Coding?
      </h1>

      {/* ... other sections remain same, abbreviated here for brevity ... */}

      <section style={{ marginTop: "2rem" }}>
        <h2 style={{ color: "#004080", marginBottom: 15 }}>Visual Process Representation</h2>

        <p><strong>Qubit States</strong></p>
        <p style={{ fontSize: 28, fontWeight: "bold", color: "#1a237e" }}>|0⟩  &nbsp;&nbsp; |0⟩</p>

        <h4 style={{ marginTop: 20 }}>Quantum Circuit Diagram</h4>
        <div style={{ display: "flex", justifyContent: "space-around", marginBottom: 20 }}>
          <div style={{ color: "#003366" }}>
            <p><strong>Qubit A</strong></p>
            <p>H</p>
            <p>X</p>
            <p>Z</p>
          </div>
          <div style={{ color: "#003366" }}>
            <p><strong>Qubit B</strong></p>
            <p>Measurement</p>
            <p>Bell Basis</p>
          </div>
        </div>

        {/* Animated Steps */}
        <ol style={{ lineHeight: 1.8 }}>
          {steps.map((step, idx) => (
            <li 
              key={idx} 
              style={{
                color: getStepColor(idx),
                fontWeight: idx === currentStep ? "bold" : "normal",
                fontSize: idx === currentStep ? 18 : 16,
                transition: "color 0.4s, font-size 0.4s",
                marginBottom: 10,
                userSelect: "none"
              }}
            >
              {step.label} {idx === currentStep ? "" : "(Waiting...)"}
            </li>
          ))}
        </ol>
      </section>

      {/* Simulation button and results below */}
      <div style={{ textAlign: "center", marginTop: 30 }}>
        <button
          onClick={runSimulation}
          disabled={loading}
          style={{
            backgroundColor: "#0070f3",
            color: "#fff",
            borderRadius: 8,
            border: "none",
            padding: "12px 36px",
            fontSize: 18,
            cursor: loading ? "not-allowed" : "pointer",
            boxShadow: "0 6px 12px rgba(0,112,243,0.4)",
            transition: "background-color 0.3s"
          }}
          onMouseEnter={e => !loading && (e.target.style.backgroundColor = "#005bb5")}
          onMouseLeave={e => !loading && (e.target.style.backgroundColor = "#0070f3")}
        >
          {loading ? "Simulating..." : "Run Simulation"}
        </button>
      </div>

      {result && (
        <section style={{ marginTop: 40, backgroundColor: "#e6f0ff", padding: 20, borderRadius: 8, border: "1px solid #99c2ff" }}>
          <h2 style={{ color: "#004080" }}>Results</h2>
          <p><strong>Original Bits:</strong> {result.original_bits}</p>
          <p><strong>Received Bits:</strong> {result.measured_bits}</p>
        </section>
      )}
    </div>
  );
}
